import React, { useState } from 'react';
import { uploadMemory } from './api';

function MemoryUploader() {
    const [file, setFile] = useState(null);
    const [title, setTitle] = useState('');
    const [message, setMessage] = useState('');
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);

    const handleUpload = async () => {
        setMessage('');
        setError('');

        if (!file) {
            setError('Please select a file first.');
            return;
        }

        if (!title.trim()) {
            setError('Please enter a title for your memory.');
            return;
        }

        setLoading(true);
        try {
            const timestamp = new Date().toISOString();

            const formData = new FormData();
            formData.append('file', file);
            formData.append('title', title);
            formData.append('timestamp', timestamp);

            const result = await uploadMemory(formData);
            setMessage(result.message || `"${title}" uploaded successfully at ${new Date(timestamp).toLocaleString()}!`);
            setTitle('');
            setFile(null);
        } catch (err) {
            setError('Failed to upload memory. Please try again.');
        }
        setLoading(false);
    };

    return (
        <div style={styles.container}>
            <h2 style={styles.header}>Upload New Memory</h2>

            <div style={styles.formGroup}>
                <label style={styles.label}>Memory Title</label>
                <input
                    type="text"
                    value={title}
                    onChange={(e) => setTitle(e.target.value)}
                    placeholder="Enter a descriptive title"
                    style={styles.input}
                    disabled={loading}
                />
            </div>

            <div style={styles.formGroup}>
                <label style={styles.label}>Memory File</label>

                <label htmlFor="fileInput" style={styles.fileButton}>
                    {file ? 'Change File' : 'ðŸ“‚ Choose File'}
                </label>
                <input
                    id="fileInput"
                    type="file"
                    onChange={(e) => setFile(e.target.files[0])}
                    style={{ display: 'none' }}
                    disabled={loading}
                />

                {file && (
                    <div style={styles.filePreview}>
                        <span style={styles.fileName}>{file.name}</span>
                        <span style={styles.fileSize}>
                            {(file.size / 1024 / 1024).toFixed(2)} MB
                        </span>
                    </div>
                )}
            </div>

            <button
                onClick={handleUpload}
                style={styles.button}
                disabled={loading}
            >
                {loading ? (
                    <div style={styles.loading}>
                        <div style={styles.spinner}></div>
                        Uploading...
                    </div>
                ) : 'Upload Memory'}
            </button>

            {message && <p style={styles.successMessage}>{message}</p>}
            {error && <p style={styles.errorMessage}>{error}</p>}
        </div>
    );
}

const styles = {
    container: {
        padding: '30px',
        borderRadius: '16px',
        background: 'rgba(25, 22, 56, 0.85)',
        border: '1px solid rgba(96, 76, 220, 0.4)',
        boxShadow: '0 6px 30px rgba(0, 0, 0, 0.25)',
        maxWidth: '500px',
        margin: '0 auto',
    },
    header: {
        color: '#e0e0ff',
        fontSize: '2rem',
        textAlign: 'center',
        marginBottom: '25px',
        background: 'linear-gradient(90deg, #8b5cf6, #6366f1)',
        WebkitBackgroundClip: 'text',
        WebkitTextFillColor: 'transparent',
    },
    formGroup: {
        marginBottom: '20px',
    },
    label: {
        display: 'block',
        marginBottom: '8px',
        color: '#a0a0e0',
        fontWeight: '500',
    },
    input: {
        width: '100%',
        padding: '12px',
        borderRadius: '8px',
        border: '1px solid rgba(96, 76, 220, 0.3)',
        background: 'rgba(15, 12, 36, 0.6)',
        color: '#e0e0ff',
        fontSize: '1rem',
    },
    fileButton: {
        display: 'inline-block',
        padding: '12px 20px',
        background: 'linear-gradient(90deg, #6366f1, #8b5cf6)',
        color: 'white',
        borderRadius: '8px',
        fontWeight: '600',
        cursor: 'pointer',
        marginBottom: '10px',
        textAlign: 'center',
        transition: 'all 0.3s ease',
    },
    filePreview: {
        background: 'rgba(15, 12, 36, 0.5)',
        border: '1px dashed rgba(96, 76, 220, 0.4)',
        borderRadius: '8px',
        padding: '10px 15px',
        marginTop: '10px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center',
    },
    fileName: {
        color: '#e0e0ff',
        overflow: 'hidden',
        textOverflow: 'ellipsis',
        whiteSpace: 'nowrap',
        maxWidth: '70%',
    },
    fileSize: {
        color: '#8a7fff',
        fontSize: '0.9rem',
    },
    button: {
        width: '100%',
        padding: '14px',
        background: 'linear-gradient(90deg, #6366f1, #8b5cf6)',
        color: 'white',
        border: 'none',
        borderRadius: '8px',
        fontSize: '1rem',
        fontWeight: '600',
        cursor: 'pointer',
        transition: 'all 0.3s ease',
    },
    loading: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        gap: '10px',
    },
    spinner: {
        width: '18px',
        height: '18px',
        border: '3px solid rgba(255, 255, 255, 0.3)',
        borderTopColor: 'white',
        borderRadius: '50%',
        animation: 'spin 1s linear infinite',
    },
    successMessage: {
        color: '#4ade80',
        backgroundColor: 'rgba(74, 222, 128, 0.1)',
        padding: '10px 15px',
        borderRadius: '8px',
        marginTop: '15px',
        borderLeft: '3px solid #4ade80',
    },
    errorMessage: {
        color: '#f87171',
        backgroundColor: 'rgba(248, 113, 113, 0.1)',
        padding: '10px 15px',
        borderRadius: '8px',
        marginTop: '15px',
        borderLeft: '3px solid #f87171',
    },
};

// Global spinner animation
const styleTag = document.createElement("style");
styleTag.innerHTML = `
@keyframes spin {
    0% { transform: rotate(0deg); }
    100% { transform: rotate(360deg); }
}
`;
document.head.appendChild(styleTag);

export default MemoryUploader;
